import './article.css';

const Article = ({ imageUrl }) => {
  return (
    <div className='avenir__blog-container_article'>
      <div className='avenir__blog-container_article-image'>
        <img src={imageUrl} alt='blog-image'/>
      </div>
    </div>
  )
}

export default Article
